import React from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  return (
    <div>
      <h1>Dashboard</h1>
      <Link to="/medicines">Manage Medicines</Link>
      <Link to="/add-medicine">Add Medicine</Link>
    </div>
  );
}

export default Dashboard;
